    `TeamName` VARCHAR(22) CHARACTER SET utf8,
    `Tempo` NUMERIC(6, 4),
    `AdjTempo` NUMERIC(6, 4),
    `OE` NUMERIC(7, 4),
    `AdjOE` NUMERIC(7, 4),
    `OffeFGPct` NUMERIC(6, 4),
    `OffTOPct` NUMERIC(6, 4),
    `OffORPct` NUMERIC(7, 5),
    `OffFTRate` NUMERIC(7, 5),
    `DE` NUMERIC(7, 4),
    `AdjDE` NUMERIC(7, 4),
    `DefeFGPct` NUMERIC(6, 4),
    `DefTOPct` NUMERIC(6, 4),
    `DefORPct` NUMERIC(7, 5),
    `DefFTRate` NUMERIC(7, 5),
    `Seed` VARCHAR(4) CHARACTER SET utf8
